import React from 'react';

const styles = {
  container: {
    display: 'flex',
    minHeight: '100vh',
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#000000', // Black background
  },
  leftPanel: {
    flex: 2,
    color: 'white',
    padding: '20px',
    textAlign: 'center',
  },
  rightPanel: {
    flex: 1,
    backgroundImage: 'url("/1.jpg")', // Use the image as background
    backgroundSize: 'cover', // Updated to cover
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center', // Center the image
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    gap: '12px',
    marginTop: '20px',
  },
  input: {
    padding: '10px',
    borderRadius: '6px',
    border: '1px solid #666',
    fontSize: '1rem',
  },
  button: {
    padding: '10px 20px',
    background: 'linear-gradient(90deg, #61dafb, #21a1f1)',
    border: 'none',
    borderRadius: '6px',
    color: 'white',
    cursor: 'pointer',
  },
};

function Feedback() {
  return (
    <div style={styles.container}>
      <div style={styles.leftPanel}>
        <header>
          <h2>Feedback</h2>
          <p>We value your feedback! Please share your thoughts below:</p>
          <form style={styles.form}>
            <input type="text" placeholder="Name" required style={styles.input} />
            <input type="email" placeholder="Email" required style={styles.input} />
            <textarea placeholder="How was your experience?" rows="3" required style={styles.input}></textarea>
            <textarea placeholder="Suggestions" rows="5" style={styles.input}></textarea>
            <button type="submit" style={styles.button}>Submit Feedback</button>
          </form>
        </header>
      </div>
      <div style={styles.rightPanel}></div>
    </div>
  );
}

export default Feedback;
